import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import styled from 'styled-components';
import Header from './components/Header';
import HomePage from './pages/HomePage';
import AboutPage from './pages/AboutPage';
import ContactPage from './pages/ContactPage';
import NoticeboardPage from './pages/noticeboard';
import WritingPage from './pages/writing';
import './App.css';

// Styled components for the main app layout
const AppContainer = styled.div`
  min-height: 100vh;
  display: flex;
  flex-direction: column;
`;

const MainContent = styled.main`
  flex: 1;
`;

const Footer = styled.footer`
  background: #2c3e50;
  color: white;
  text-align: center;
  padding: 2rem 0;
  margin-top: auto;
`;

const FooterContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2rem;
`;

const FooterLinks = styled.div`
  display: flex;
  justify-content: center;
  gap: 2rem;
  margin-bottom: 1rem;
`;

const FooterLink = styled.a`
  color: #ecf0f1;
  text-decoration: none;
  transition: color 0.3s ease;

  &:hover {
    color: #3498db;
  }
`;

const Copyright = styled.p`
  color: #bdc3c7;
  font-size: 0.9rem;
`;

function App() {
  return (
    <Router>
      <AppContainer>
        <Header />
        <MainContent>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/about" element={<AboutPage />} />
            <Route path="/contact" element={<ContactPage />} />
            <Route path="/noticeboard" element={<NoticeboardPage />} />
            <Route path="/writing" element={<WritingPage />} />
            <Route path="/game" element={<BaseballGamePage />} />
          </Routes>
        </MainContent>
        <Footer>
          <FooterContent>
            <FooterLinks>
              <FooterLink href="/">홈</FooterLink>
              <FooterLink href="/about">BKO</FooterLink>
              <FooterLink href="/contact">게임</FooterLink>
              <FooterLink href="/noticeboard">게시판</FooterLink>
            </FooterLinks>
            <Copyright>
              © 2024 Baseball Game App. All rights reserved.
            </Copyright>
          </FooterContent>
        </Footer>
      </AppContainer>
    </Router>
  );
}

// Baseball Game Page Component
const BaseballGamePage = () => {
  const GameContainer = styled.div`
    padding: 2rem;
    max-width: 1200px;
    margin: 0 auto;
  `;

  const GameTitle = styled.h1`
    text-align: center;
    color: #2c3e50;
    margin-bottom: 2rem;
    font-size: 2.5rem;
  `;

  const GameFrame = styled.iframe`
    width: 100%;
    height: 600px;
    border: none;
    border-radius: 10px;
    box-shadow: 0 5px 15px rgba(0, 0, 0, 0.1);
  `;

  const GameInfo = styled.div`
    background: #f8f9fa;
    padding: 1.5rem;
    border-radius: 10px;
    margin-top: 2rem;
    text-align: center;
  `;

  return (
    <GameContainer>
      <GameTitle>⚾ Baseball Game</GameTitle>
      <GameFrame 
        src="http://localhost:3000" 
        title="Baseball Game"
      />
      <GameInfo>
        <h3>게임 사용법</h3>
        <p>
          위의 게임을 플레이하려면 별도의 창에서 
          <a href="http://localhost:3000" target="_blank" rel="noopener noreferrer" style={{color: '#3498db', textDecoration: 'none'}}> 
            여기
          </a>를 클릭하세요.
        </p>
      </GameInfo>
    </GameContainer>
  );
};

export default App;
